import React, {useState} from 'react';
import axios from 'axios';


async function getGender(name) {
    try {
        const response = await axios.get(`https://api.genderize.io?name=${name}`);
        return response.data.gender;
    } catch (error) {
        console.error(error);
    }
}


function SearchName() {
    const [name, setName] = useState('');
    const [gender, setGender] = useState('');

    const handleSubmit = async (event) => {
        event.preventDefault();
        const gender = await getGender(name);
        setGender(gender);
    }

    return (
        <div className="parent-paragraph">
            <div className="paragraph">
                <form className="" onSubmit={handleSubmit}>
                    <label>

                        <input  type="text" className="form-name"  placeholder="Enter your name" value={name}
                               onChange={(event) => setName(event.target.value)}/><span>
                        <button type="submit"><i
                        className="fa-sharp  fa-solid fa-magnifying-glass"></i></button></span>
                    </label>

                    {gender && <p>The gender for the name "{name}" is "{gender}".</p>}
                </form>
            </div>
        </div>


    );
}

export default SearchName;
